import './All_tools.css';
import railsimage from '../../../images/Icons/rails.png'

function AllTools() {

  // const rails = 'https://raw.githubusercontent.com/lewagon/fullstack-images/master/uikit/breakfast.jpg'


  return (
    <div>
      <p>All Tools</p>
      <img className="icon" src={railsimage} alt="Ruby icon" />
      <img className="icon" src={railsimage} alt="JavaScript" />
      <img className="icon" src={railsimage} alt="React" />
      <img className="icon" src={railsimage} alt="Redux" />
      <img className="icon" src={railsimage} alt="REST API" />
      <p>PostgreSQL</p>
      <p>HTML</p>
      <p>Bootstraps</p>
      <p>Github</p>
      <p>Figma</p>
      <p>Trello</p>
      <p>Salesforce</p>
    </div>
  )
}

export default AllTools;
